import React from "react";

const NoteCard = ({ note, onEdit, onDelete }) => (
    <div>
        <h3>{note.title}</h3>
        <p>{note.content}</p>
        <button onClick={() => onEdit(note)}>Edit</button>
        <button onClick={() => onDelete(note.id)}>Delete</button>
    </div>
);

export default NoteCard;
